import React from 'react';
import './list.css';
import App from './App';
import '.card.js';

function listTemp(header, cards) {

    return (
    <section class="List">
        <header class="List-header">
            <h2>{header}</h2>
        </header>
        <div class="List-cards">
            {cards.title}
            {cards.content}
        </div>
    </section>
    );
  }

  //do we .map here?

  export default App;
